import React from "react";
import { BrowserRouter, Routes, Route, Switch } from "react-router-dom";

import Seconds from "./Seconds";

import "./App.css";
import "./reset.css";

function App() {
  return (
    <BrowserRouter>
      <SWitch>
        <div className="App">
          <Routes>
            <Route path="/" element={<Seconds />}></Route>
          </Routes>
        </div>
      </SWitch>
    </BrowserRouter>
  );
}

export default App;
